import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  const [searchTerm, setSearchTerm] = React.useState('');

  const handleSearchTermChange = (event) => {
    setSearchTerm(event.target.value);
  };
  return (
      <div className="App">
        <div className="black-nav">
          <div>단어퀴즈</div>
        </div>
        <h4>TEST</h4>
      </div>
  );
}


export default App;
